import React from 'react';
import {
  ChakraProvider,
  Box,
  Container,
  Heading,
  Text,
  extendTheme
} from '@chakra-ui/react';
import "@fontsource/poppins.css"

function App() {
  //BG #282A37 CMPNT #01CC90
  const config = {
    styles: {
      global: () => ({
        body: {
          bg: "#282A37",
          color: "black",
        },
        fonts: {
          heading: "Poppins",
          body: "Poppins",
        }
      }),
    },
  }
  const theme = extendTheme(config);
  return (
    <ChakraProvider theme={theme}>
      <Heading color="black" fontSize="5xl" textAlign="center" mt={0} minW="100vw"> 
        Image Compression
      </Heading>
      <Box fontSize="5xl">
      halo
      </Box>
    </ChakraProvider>
  );
}

export default App;
